import Logo from "../../assets/logo";

function Header() {
  return (
    <div className="component-container header">
      <Logo />
      <div className="nav-buttons">
        <a href="#" className="info-channel">
          Info Channel
        </a>
        <a href="#" className="participants">
          Participants
        </a>
      </div>
    </div>
  );
}

export default Header;
